import React from 'react';
import Mapa from "../../Utils/Img/Localidad/mapa.png";



function Cajamapa() {
	return (



		<div className = "Contenidolocalidad" >
			
			<img id="imglocalidad" src={Mapa} alt="mapa" useMap="#mapa"/>
			<map id="mapa">
				  <area shape="circle" coords="4,434,80" href="https://www.youtube.com/watch?v=Ez6HKcVtPRs" />
			
			</map>

		</div>






	);
}

export default Cajamapa;
